import Link from 'next/link';
import date from './date';
//var now=new  Date().toLocaleString();
var now=1;
const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
        </Link>
    <Link href="/">
<a style={linkStyle}>{now}</a>
        </Link>
  </div>

);

export default Header;
